import { createContext, useState } from "react";

const AuthenContext = createContext()
const AuthenContextProvider = ({ children }) => {
    const list ={
        username: "",
        password: "",
        role: ""
    }
    const [forms, setForms] = useState(list)

    const { username, password, role } = forms
    const value = {
        forms,
        username,
        password
    }
    return (
        <AuthenContextProvider.Provider value={value}>
            {children}
        </AuthenContextProvider.Provider>
    )
}
export default AuthenContextProvider
